    tr = "1. Kar\196\177nca yuvas\196\177nda ne kadar Mimar Kar\196\177nca oldu\196\159unu kontrol etmek ve bina in\197\159aatlar\196\177ndaki ayr\196\177nt\196\177l\196\177 ilerlemeyi g\195\182rmek i\195\167in butona t\196\177kla; Krali\195\167enin seviyesini y\195\188kselterek ve sat\196\177n alarak daha fazla Mimar Kar\196\177nca elde edebilirsin. 2. Geli\197\159tirmelerde ara\197\159t\196\177rma yapmak i\195\167in birka\195\167 geli\197\159tirme se\195\167ebilirsin. Geli\197\159tirmeler, istatistiklerini b\195\188y\195\188k \195\182l\195\167\195\188de art\196\177racakt\196\177r. 3. \196\176lerleme Birimlerinde sava\197\159 birimlerini y\195\182netebilirsin.",
    es = "1. Haga clic en este bot\195\179n para ver el n\195\186mero actual de hormigas obreras en el hormiguero y la situaci\195\179n espec\195\173fica de la construcci\195\179n del edificio; la cantidad de hormigas obreras aumentar\195\161 con el nivel del nido y la compra. 2. Haga clic para ingresar a la interfaz principal de evoluci\195\179n, seleccione diferentes evoluciones para actualizar y mejorar los atributos de la peque\195\177a hormiga. 3. En la entrada de la cola de batalla, las peque\195\177as hormigas pueden organizar tropas aqu\195\173.",
    pt = "1. Clique no bot\195\163o para verificar quantas Formigas Construtoras voc\195\170 tem em seu formigueiro e veja o progresso detalhado nas constru\195\167\195\181es de edif\195\173cios; voc\195\170 pode obter mais Formigas Construtoras ao aumentar o n\195\173vel de sua Rainha e por compras. 2. Nas Evolu\195\167\195\181es, voc\195\170 pode selecionar um n\195\186mero de evolu\195\167\195\181es para pesquisar. As evolu\195\167\195\181es aumentam incrivelmente suas estat\195\173sticas. 3. Nas Unidades de Marcha, voc\195\170 pode gerenciar suas unidades de combate.",
    it = "1. Fai clic sul pulsante per controllare quante Formiche costruttrici hai nel formicaio e vedere i progressi dettagliati sulle costruzioni; puoi ottenere pi\195\185 Formiche costruttrici facendo salire di livello la tua Regina e gli acquisti. 2. In Evoluzioni, \195\168 possibile selezionare una serie di evoluzioni per la ricerca. Le evoluzioni aumenteranno notevolmente le tue statistiche. 3. Nelle unit\195\160 di marcia, puoi gestire le tue unit\195\160 di combattimento."
