    tr = "Kilitli arazinin kilidi a\195\167\196\177ld\196\177\196\159\196\177nda, siyah toprak i\195\167inde baz\196\177 parlayan yerler bulacaks\196\177n. Araziye t\196\177klad\196\177\196\159\196\177nda, bir k\195\188rek simgesi g\195\182r\195\188necektir. Ard\196\177ndan, kazmak i\195\167in k\195\188re\196\159e t\196\177klayabilirsin. Siyah topraklar\196\177 kazarken sadece kar\196\177nca yuvas\196\177n\196\177 geni\197\159letmekle kalmaz, ayn\196\177 zamanda \197\159ans eseri \195\182d\195\188ller de kazanabilirsin!",
