    pt = "Quando a terra bloqueada for aberta, voc\195\170 encontrar\195\161 algumas terras negras brilhantes. Ao clicar na terra, aparece um \195\173cone de p\195\161. Ent\195\163o voc\195\170 pode clicar na p\195\161 e come\195\167ar a cavar. Ao cavar as terras negras, n\195\163o apenas pode expandir seu formigueiro, mas tamb\195\169m pode ter a chance de ganhar recompensas!",
    it = "Quando la terra che bloccata viene sbloccata, troverai alcune terre nere scintillanti. Quando clicchi sulla terra, apparir\195\160 un'icona a forma di pala. Quindi, puoi fare clic sulla pala per scavare. Quando scavi nelle terre nere, non solo puoi espandere il formicaio, ma puoi anche ottenere ricompense in maniera fortuita!"
