    es = "El desbloqueo de habilidades tiene requisitos para el nivel y la melaza. Las habilidades espec\195\173ficas deben ser desbloqueadas por caparazones de hormigas especializadas; el nivel de habilidad de cada hormiga especializada tiene un l\195\173mite de 10, y las actualizaciones requieren [esporas mutantes], que se pueden llevar a la peque\195\177a hormiga despu\195\169s de que la habilidad sea Para obtener atributos poderosos, aseg\195\186rese de acumular m\195\161s recursos y materiales de los juegos diarios.",
    pt = "Desbloquear habilidades precisa de melado e n\195\173veis de Formigas Especiais, habilidades espec\195\173ficas tamb\195\169m precisam de Conchas de Formigas Especiais para desbloquear. O n\195\173vel m\195\161ximo de cada habilidade \195\169 10. Melhorar as habilidades exigem [Esporo]. As habilidades trazem enormes benef\195\173cios nas batalhas e no desenvolvimento. Lembre-se sempre de coletar materiais e recursos para melhorar as habilidades.",
    it = "Sbloccare le abilit\195\160 richiede livelli di melata e formiche speciali, abilit\195\160 specifiche hanno anche bisogno di gusci di formiche speciali per essere sbloccate. Il livello massimo di ogni abilit\195\160 \195\168 10. Migliorare le abilit\195\160 richiede [Spore]. Le abilit\195\160 ti porteranno enormi vantaggi nelle battaglie e nello sviluppo. Ricorda sempre di raccogliere materiali e risorse per migliorare le abilit\195\160."
