    pt = "O evento de A\195\167\195\163o da Col\195\180nia \195\169 uma s\195\169rie de eventos rotativos. O evento muda a cada hora. Existem 3 n\195\173veis de recompensas por hora. A Fada sugere que voc\195\170 tente conseguir as recompensas de N\195\173vel 1 e 2 a cada hora. Entre 5 minutos a cada hora, voc\195\170 ver\195\161 que \195\169 muito f\195\161cil terminar o N\195\173vel 1 e 2.",
    it = "L'evento Colony Action \195\168 costituito da una serie di eventi a rotazione. L'evento cambier\195\160 ogni ora. Ci sono 3 livelli di ricompense ogni ora. La Fata ti suggerisce di provare a ottenere ricompense di livello 1 e 2 ad ogni ora. Accedi per 5 minuti ogni ora, vedrai che \195\168 abbastanza facile completare i livelli 1 e 2."
