    tr = "[Liderlik] Geli\197\159imi: Tek bir Birime en fazla 3 \195\150zel Kar\196\177nca yerle\197\159tirilebilir. \195\156\195\167 \195\182zel kar\196\177nca i\195\167in 3 yerin hepsinin kilidini a\195\167mak i\195\167in \195\182nce bir Harekat Merkezi in\197\159a etmen ve [Birincil Liderlik], [\196\176kincil Liderlik] ve [\195\156\195\167\195\188nc\195\188l Liderlik] dahil olmak \195\188zere Liderlik geli\197\159tirmelerini tamamlaman gerekir. Ve [Pro Harekat Merkezi], [Harekat Merkezi I], [Harekat Merkezi II] ve [Harekat Merkezi III] olmak \195\188zere 4 Harekat Merkezine sahip olabilirsin. Bu harekat merkezleri s\196\177ras\196\177yla [Pro Birim], [Birim I], [Birim II], [Birim III] i\195\167in kullan\196\177l\196\177r. Pro Birim, S\196\177n\196\177f bonuslar\196\177ndan yararland\196\177\196\159\196\177 i\195\167in, \195\182nce Pro Birim i\195\167in t\195\188m geli\197\159tirmeleri tamamlamak daha iyidir.",
    es = "Combate cooperativo: en la actualidad, un equipo de marcha puede enviar hasta 3 hormigas especializadas para salir, y para desbloquear las tres hormigas especializadas para marchar se requiere investigar la evoluci\195\179n del combate coordinado en la flora evolutiva; construir 4 marchas en el hormiguero. Despu\195\169s del lugar de reuni\195\179n, puedes encontrar la clasificaci\195\179n evolutiva relevante en la flora evolutiva [Formaci\195\179n especial], [Formaci\195\179n I], [Formaci\195\179n II] y [Formaci\195\179n III]; si quieres llevar hormigas especializadas a marchar juntas, necesitas estudiar Evoluciones relacionadas en estas clasificaciones evolutivas: [Operaciones cooperativas elementales], [Operaciones cooperativas intermedias], [Operaciones cooperativas avanzadas]; Orden de investigaci\195\179n recomendado: Formaci\195\179n especial-Formaci\195\179n 1-Formaci\195\179n 2-Formaci\195\179n 3.",
    pt = "Evolu\195\167\195\163o [Lideran\195\167a]: Podem ser desenvolvidas at\195\169 3 Formigas Especiais em uma \195\186nica Unidade. Para desbloquear 3 vagas, voc\195\170 precisa primeiro construir um Centro de Agrupamento e evoluir as evolu\195\167\195\181es de Lideran\195\167a, incluindo [Lideran\195\167a Principal], [Lideran\195\167a Secund\195\161ria] e [Lideran\195\167a Terci\195\161ria]. E voc\195\170 pode ter at\195\169 4 Centros de Agrupamento, incluindo [Centro de Agrupamento Pro], [Centro de Agrupamento I], [Centro de Agrupamento II] e [Centro de Agrupamento III], que significam [Unidade Pro], [Unidade I], [Unidade II], [Unidade III]. \195\137 melhor pesquisar todas as evolu\195\167\195\181es para a Unidade Pro primeiro, logo que a Unidade Pro se beneficia dos b\195\180nus da Classe.",
    it = "[Leadership] Evoluzione: \195\136 possibile schierare fino a 3 formiche speciali in una singola unit\195\160. Per sbloccare tutti e 3 gli slot, devi prima costruire un Centro di raduno ed eseguire le evoluzioni della Leadership, tra cui [Leadership primaria], [Leadership secondaria] e [Leadership terziaria]. E puoi avere fino a 4 Centri di raduno, tra cui [Centro di raduno Pro], [Centro di raduno I], [Cetro di raduno II] e [Centro di raduno III], che corrispondono all\226\128\153[Unit\195\160 Pro], [Unit\195\160 I], [Unit\195\160 II], [Unit\195\160 III]. \195\136 meglio effettuare prima tutte le evoluzioni per l'unit\195\160 Pro, poich\195\169 beneficia dei bonus di classe."
