    tr = "Krallar\196\177n Sava\197\159\196\177 ba\197\159lad\196\177\196\159\196\177nda, Y\195\182neticiler Bolluk \195\156lkesine sahip olabilmek i\195\167in birbirleriyle sava\197\159acaklar. A\196\159ac\196\177 i\197\159gal eden \196\176ttifak, B\195\182lgenin Kar\196\177nca Kral\196\177 i\195\167in aday g\195\182sterme hakk\196\177na sahip olacak. Kral olmak, pozisyonlar atamana veya di\196\159er Y\195\182neticileri cezaland\196\177rmana imkan verecektir.",
    es = "Despu\195\169s de que comience la batalla por el rey de las hormigas, las hormigas peque\195\177as pueden reunirse en el \195\161rea central para luchar por la gloria del rey de las hormigas, y la alianza que finalmente ocupe esta tierra tendr\195\161 derecho a elegir al rey de las hormigas en esta \195\161rea. Convi\195\169rtete en un rey de las hormigas para disfrutar de poderosas ganancias de BUFF y tienes derecho a nombrar y castigar a otras hormigas peque\195\177as.",
    pt = "Quando a Guerra dos Reis come\195\167a, os Governantes lutam uns contra os outros em prol do controle da Terra da Abund\195\162ncia. A Alian\195\167a que ocupou a \195\129rvore ter\195\161 o direito de nomear o Rei Formiga da Zona. Tornar-se o Rei permite que voc\195\170 designe cargos ou puna outros Governantes.",
    it = "Quando inizier\195\160 la Guerra dei Re, i sovrani combatteranno l'uno contro l'altro per lottare per la propriet\195\160 della Terra dell'Abbondanza. L'Alleanza che ha occupato l'Albero avr\195\160 il diritto di nominare il Re Formica della Zona. Diventare il Re ti permetter\195\160 di nominare posizioni o punire altri Sovrani."
