    tr = "Krallar Sava\197\159\196\177 s\196\177ras\196\177nda E\197\159ek H\196\177yarlar\196\177n\196\177 i\197\159gal ederek Bolluk \195\156lkesine takviyeye gelen asker kar\196\177ncalara destek olabilirsin. Bolluk \195\156lkesi di\196\159er ittifaklar taraf\196\177ndan i\197\159gal edilirse, d\195\188\197\159man Birimin g\195\188c\195\188, E\197\159ek H\196\177yar\196\177n\196\177n s\195\188rekli sald\196\177rmas\196\177ndan dolay\196\177 zay\196\177flayacakt\196\177r. Bu nedenle, o E\197\159ek H\196\177yarlar\196\177n\196\177 i\197\159gal etmek seni avantajl\196\177 bir konuma getirecektir.",
    es = "Durante la pelea, las ardillas que ocupan el borde de la tierra f\195\169rtil bien pueden proteger a los soldados que refuerzan la tierra f\195\169rtil; si la tierra f\195\169rtil est\195\161 ocupada por otras peque\195\177as alianzas de hormigas, el poder de las ardillas tambi\195\169n puede usarse para debilitar la fuerza de la tierra f\195\169rtil. las tropas y ganar de una sola vez; \194\161Se recomienda que las peque\195\177as hormigas tengan prioridad sobre la sand\195\173a y tomen una ubicaci\195\179n favorable!",
    pt = "Ao ocupar Lan\195\167adores durante a Guerra dos Reis, voc\195\170 pode apoiar as Formigas Soldados que estiverem oferecendo refor\195\167os na Terra da Abund\195\162ncia. Se a Terra da Abund\195\162ncia estiver ocupada por outras alian\195\167as, a for\195\167a da Unidade inimiga ser\195\161 enfraquecida com os ataques cont\195\173nuos dos Lan\195\167adores. Portanto, ocupar os Lan\195\167adores colocar\195\161 voc\195\170 em uma posi\195\167\195\163o favor\195\161vel.",
    it = "Occupando gli Spruzzatori durante la Guerra dei Re, puoi sostenere le formiche soldato che si stanno rafforzando nella Terra dell'Abbondanza. Se la Terra dell'Abbondanza \195\168 occupata da altre alleanze, la forza dell'Unit\195\160 nemica sar\195\160 indebolita dai continui attacchi degli Spruzzatori. Pertanto, ti metter\195\160 in una posizione favorevole se occupi quegli Spruzzatori."
