    en = "Rulers with King appointed positions will get position featured buffs. Each position's buff is unique. For example, Resource Output bonus, Soldier Ants Hatch Speed bonus or Troop Defense bonus, etc. Aside from appointing positions, being the Ant King will also receive an Exclusive Pack for Kings. And even more, during the Kings' term, the King can reward packs to other rulers, turning on Zone buffs, and the King will have an exclusive chat frame in his/her term!",
    gr = "Die Ameisen, die vom Ameisenk\195\182nig ernannt werden, erhalten nach den Arten der angetretenen \195\132mter verschiedene Buff-Effekte,\nz.B Erh\195\182hung der Produktionsmenge, Erh\195\182hung der Ausbildungsgeschwindigkeit der Soldaten, Erh\195\182hung von dem Angriff und der Verteidigung der Einheiten usw; Allerdings werden die Ameisen, die vom Ameisenk\195\182nig bestraft werden, verschiedene Debuff-Effekte beeinflusst, z.B Reduzierung von dem Angriff und der Verteidigung der Einheiten, Erh\195\182hung der Ressourcenverbrauch, Verlangsamung der Marschgeschwindigkeit usw. Zus\195\164tzlich zu oben genannten Befugnissen zur Ernennung und Bestrafung wird der Ameisenk\195\182nig nach dem Dienstantritt eine exclusive Belohnung f\195\188r Ameisenk\195\182nig sofort erhalten. Dar\195\188ber hinaus kann der Ameisenk\195\182nig w\195\164hrend der Amtszeit Geschenkpacks an andere Ameisen senden und die Region-Buff aktivieren; W\195\164hrend der Amtszeit kann der Ameisenk\195\182nig die spezielle Sprechblase bekommen, die seinen edlen Status im Chat zeigen kann!",
