    tr = "Haz\196\177rl\196\177k E\197\159le\197\159mesi: 1 raunttur, 7 g\195\188n s\195\188rer. \196\176lk 5 g\195\188n\195\188n etkinlikleri sistem taraf\196\177ndan atan\196\177r. 6'\196\177nc\196\177 g\195\188nde y\195\182neticiler, birden fazla etkinlik aras\196\177ndan istediklerini se\195\167ebilirler ve 7'inci g\195\188nde ana etkinlik Da\196\159 S\196\177\195\167an\196\177 Bast\196\177rma olacakt\196\177r. Yeni b\195\182lgeler i\195\167in ilk En G\195\188\195\167l\195\188 Sava\197\159 B\195\182lgesi etkinli\196\159i, yaln\196\177zca Haz\196\177rl\196\177k E\197\159le\197\159mesi olacakt\196\177r. Haz\196\177rl\196\177k E\197\159le\197\159mesinin ard\196\177ndan Is\196\177nma E\197\159le\197\159mesi yap\196\177lacakt\196\177r.",
    es = "Preliminares: 1 ronda, 7 d\195\173as. En los primeros cinco d\195\173as, habr\195\161 tareas tem\195\161ticas organizadas de forma fija por el sistema; las tareas tem\195\161ticas del sexto d\195\173a pueden ser seleccionadas por el comandante en muchos tipos de trabajo; la tarea tem\195\161tica del s\195\169ptimo d\195\173a es suprimir la marmota; el \195\161rea es la primera vez Los partidos regionales m\195\161s fuertes son los preliminares. Despu\195\169s de las preliminares, comenzar\195\161 el partido de calentamiento.",
    pt = "Partida de Prepara\195\167\195\163o: Dura 1 rodada, 7 dias. Os eventos dos 5 primeiros dias s\195\163o atribu\195\173dos pelo sistema. No 6\194\186 dia, os governantes podem escolher no que est\195\163o interessados dentro v\195\161rios eventos e, no 7\194\186 dia, o evento principal ser\195\161 a Supress\195\163o da Marmota. Para as zonas novas, a Zona de Guerra Mais Forte da primeira vez ser\195\161 somente de Partidas de Prepara\195\167\195\163o. Depois da Partida de Prepara\195\167\195\163o, ser\195\163o as Partidas de Aquecimento.",
    it = "Partita di preparazione: 1 round per 7 giorni. Gli eventi dei primi 5 giorni saranno assegnati dal sistema. Il sesto giorno, i Sovrani possono scegliere l\226\128\153evento che preferiscono tra pi\195\185 eventi, e il settimo giorno, l'evento principale sar\195\160 la Soppressione della Marmotta. Per le nuove zone, la prima volta la zona di guerra pi\195\185 forte sar\195\160 costituita solo dalle partite di preparazione. Dopo le partite di preparazione sar\195\160 la volta delle Partite di riscaldamento."
