    en = [[
Warm-Up Match: Lasts for 2 rounds, 7 days each. The events of the first 5 days will be assigned by the system. On the 6th days, rulers can choose what you are interested in among multiple events, and on the 7th days of the first round, the main event will be Groundhog Suppression; Second Rounds' 7th days will be Warzone Expedition. Attention: After one Warm-Up Match, the zone will enter the Ranked Matches. 
