    gr = "Aufw\195\164rm-Match: Es dauert 2 Runden und jede Runde l\195\164uft 7 Tage. Die Aufgaben von den ersten 5 Tagen ist gleich wie die Aufgaben im Vorkampf. Am 6. Tag muss man die Aufgabe manuell ausw\195\164hlen und erledigen. Das Thema am 7. Tag in der ersten Runde ist Murmeltierunterdr\195\188ckung. Das Thema am 7. Tag in der zweiten Runde ist Regionalschlacht. Achtung: Nachdem eine Region das am Aufw\195\164rm-Match teilgenommen hat, wird diese Region das Stufen-Match betreten.\nStufen-Match: Die Eventzeit und der Inhalt vom Stufen-Match ist gleich wie das Aufw\195\164rm-Match. Der Sieg und die Niederlage jeder Woche werden die Stufen-Punkte der Region beeinflussen. Die Stufen-Punkte beeinflussen den Aufstieg und Abstieg der regionalen Stufe. Je h\195\182her die Stufe ist, desto besser sind die Belohnungen!",
