    tr = "Is\196\177nma E\197\159le\197\159mesi: Her biri 7 g\195\188n olmak \195\188zere 2 raunt s\195\188rer. \196\176lk 5 g\195\188n\195\188n etkinlikleri sistem taraf\196\177ndan atan\196\177r. 6'\196\177nc\196\177 g\195\188nde y\195\182neticiler, birden fazla etkinlik aras\196\177ndan istediklerini se\195\167ebilirler ve 7'nci g\195\188nde ana etkinlik Da\196\159 S\196\177\195\167an\196\177 Bast\196\177rma olacakt\196\177r; \196\176kinci Raunt'un 7'nci g\195\188n\195\188 Sava\197\159 B\195\182lgesi Ke\197\159fi olacakt\196\177r. Dikkat: Bir Is\196\177nma E\197\159le\197\159mesinden sonra b\195\182lge, R\195\188tbeli E\197\159le\197\159meye girecektir. \nS\196\177ral\196\177 E\197\159le\197\159me: S\196\177ral\196\177 E\197\159le\197\159meler, Is\196\177nma E\197\159le\197\159mesi ile ayn\196\177 i\195\167eri\196\159e ve s\195\188reye sahiptir. Ancak t\195\188m Kazan\196\177mlar ve Kay\196\177plar, b\195\182lgenin S\196\177ralama puan\196\177n\196\177 etkileyecektir. S\196\177ralama puanlar\196\177, b\195\182lgenin s\196\177ralamas\196\177n\196\177n y\195\188kselmesine veya d\195\188\197\159mesine neden olur. Daha y\195\188ksek s\196\177ralamaya sahip olanlar daha fazla \195\182d\195\188l al\196\177rlar.",
    es = "Calentamiento: 2 rondas, 7 d\195\173as en cada ronda. Las tareas para los primeros cinco d\195\173as son las mismas que las preliminares; el sexto d\195\173a a\195\186n debe ser seleccionado para completar; el s\195\169ptimo d\195\173a de la primera ronda es el tema de la supresi\195\179n de la marmota; el s\195\169ptimo d\195\173a de la segunda ronda es la conquista regional. Nota: Despu\195\169s de un partido de calentamiento en la regi\195\179n, entrar\195\161 en el partido de clasificaci\195\179n. \n Torneo de clasificaci\195\179n: el tiempo de actividad y el contenido del Torneo de clasificaci\195\179n son los mismos que los del Torneo de calentamiento, pero las victorias y derrotas semanales afectar\195\161n los puntos de clasificaci\195\179n regional. Los puntos de clasificaci\195\179n afectan la promoci\195\179n y promoci\195\179n de las clasificaciones regionales. cuanto m\195\161s alto sea el ranking, mejores ser\195\161n las recompensas que puede obtener.",
    pt = "Partida de Aquecimento: Dura 2 rodadas, 7 dias cada. Os eventos dos 5 primeiros dias s\195\163o atribu\195\173dos pelo sistema. No 6\194\186 dia, os governantes podem escolher no que est\195\163o interessados dentro v\195\161rios eventos e, no 7\194\186 dia da primeira rodada, o evento principal ser\195\161 a Supress\195\163o da Marmota. O 7\194\186 dia da Segunda Rodada ser\195\161 a Expedi\195\167\195\163o da Zona de Guerra. Aten\195\167\195\163o: Depois da Partida de Aquecimento, a zona entra nas Partidas de Classifica\195\167\195\163o. \nPartida de Classifica\195\167\195\163o: As Partidas de Classifica\195\167\195\163o possuem o mesmo conte\195\186do e dura\195\167\195\163o das Partidas de Aquecimento. Mas todas as Vit\195\179rias e Derrotas afetam o ponto de Classifica\195\167\195\163o da zona. Pontos de Classifica\195\167\195\163o causam a promo\195\167\195\163o ou rebaixamento da classifica\195\167\195\163o da zona. Quanto mais alta a classifica\195\167\195\163o, melhores as recompensas.",
    it = "Partita di riscaldamento: 2 round, 7 giorni ciascuno. Gli eventi dei primi 5 giorni saranno assegnati dal sistema. Il sesto giorno, i Sovrani possono scegliere l\226\128\153evento che preferiscono tra pi\195\185 eventi, e il settimo giorno del primo turno, l'evento principale sar\195\160 la Soppressione della Marmotta; il settimo giorni del Secondo Turno si terr\195\160 la Spedizione nella Zona di Guerra. Attenzione: Dopo una partita di riscaldamento, la zona entrer\195\160 nelle partite di classifica. \nPartite di classifica: Le partite di classifica hanno lo stesso contenuto e la stessa durata delle partite di riscaldamento. Ma tutte le vincite e le perdite influenzeranno la classifica nella zona. I punti ottenuti permeteranno la promozione o il declassamento del grado della zona. Gradi pi\195\185 alti assegneranno pi\195\185 ricompense."
