    es = "Utilice monstruos de la misma calidad y menores o iguales a su propia calificaci\195\179n de estrellas como material para las estrellas en ascenso. Hay una cierta tasa de \195\169xito para cada actualizaci\195\179n de estrellas, que est\195\161 determinada por la calificaci\195\179n de estrellas del material. Cuanto mayor sea la calificaci\195\179n de estrellas del material, mayor ser\195\161 la tasa de \195\169xito. El material desaparecer\195\161 despu\195\169s de que la puesta en marcha sea exitosa. Si la puesta en marcha falla, el material se reducir\195\161 en 1 estrella. Si es un material de 1 estrella, desaparecer\195\161 directamente.",
    pt = "Voc\195\170 pode usar insetos com Estrelas mais baixas ou equivalentes, mas a mesma raridade com o inseto alvo e os materiais de Aumento de Estrelas. Aumento de Estrelas possui taxas de sucesso, a possibilidade depende das estrelas do material. Quanto mais estrelas, maiores as chances de sucesso. O Inseto Material \195\169 gasto depois de um Aumento de Estrela bem-sucedido. Se o Aumento de Estrela falhar, a estrela do material reduz em 1. Se o material for um inseto de 1 Estrela, ele ser\195\161 gasto.",
    it = "Puoi usare insetti con una stella pi\195\185 bassa o equivalente ma con la stessa rarit\195\160 dell'insetto di destinazione come materiali della stella. Le stelle hanno tassi di successo, la possibilit\195\160 dipende dai materiali della stella. Pi\195\185 alta \195\168 la stella, pi\195\185 alte sono le possibilit\195\160 di successo. Il materiale dell\226\128\153insetto sar\195\160 speso dopo la salita di livello della stella. Se la salita di livello della stella non riesce, il materiale della stella scender\195\160 di 1 stella. Se il materiale \195\168 un insetto di 1 stella, sar\195\160 speso."
